import styled from 'styled-components/macro';



export const cardImage = styled.div`
    display: flex;
    color: white;
`

export const ContentBlock = styled.div`
    position: relative;
    flex: calc(18vw - 4px);
    flex-shrink: 0;
    height: 9.5vw;
    margin-right: 4px;

    img {
        height: 100%;
        width: 100%;
        pointer-events: none;
    }
    
`
